import React from "react";
import { Hidden } from "reakit";
import DownArrowIcon from "../Root/assets/down-arrow-icon.png";
import UpArrowIcon from "../Root/assets/up-arrow-icon.png";

import { Flex, styled } from "reakit";

const LogoIcon = styled.img`
  height: 20px;
  width: 20px;
  padding: 12px 0 0 30px;
`;

const TreeStyle = styled.label`
  padding: 0.2rem;
  color: ${Colors.DustGray};
  font-size: ${Fonts.FontSize.medium};
  display: ${(props) => (!props.active ? "none" : "block")};
  padding-top: 15px;
  padding-left: 10px;
  cursor: pointer;
`;

const Tree = (props) => {
  return (
    <Hidden.Container>
      {(hidden) => (
        <>
          <Hidden.Toggle {...hidden} style={{ color: "white" }}>
            {!hidden.visible ? (
              <LogoIcon src={DownArrowIcon} />
            ) : (
              <LogoIcon src={UpArrowIcon} />
            )}
            Category
          </Hidden.Toggle>
          <Hidden style={{ color: "white" }} {...hidden}>
            Hidden
          </Hidden>
          <Hidden visible={hidden}></Hidden>
        </>
      )}
    </Hidden.Container>
  );
};

export default Tree;
